import React, {Component} from 'react';
import {Button,Dropdown,Menu} from 'semantic-ui-react';
import 'semantic-ui-css/semantic.min.css';
import './navbar.css';


class Navbar extends Component  {
    state = { activeItem: 'home' }

  handleItemClick = (e, { name }) => this.setState({ activeItem: name })
    
    render() {
        const { activeItem } = this.state;
        return (
            
            <div className = 'navbar'>
                
            <Menu inverted borderless size='huge'>
            <Menu.Item mini>
             <img src='/logo.png' />
            </Menu.Item>
            <Menu.Item header>Dijkstra Visualizer</Menu.Item>
            <Menu.Item
              name='home'
              active={activeItem === 'home'}
              
            />
            <Menu.Item
              name='messages'
              active={activeItem === 'messages'}
              
            />
            
              <Button positive className = "dijkstra-button">Dijkstra Visualizer</Button>
          
    
            <Menu.Menu position='right'>
              <Dropdown item text='Speed'>
                <Dropdown.Menu>
                  <Dropdown.Item>Fast</Dropdown.Item>
                  <Dropdown.Item>Average</Dropdown.Item>
                  <Dropdown.Item>Slow</Dropdown.Item>
                </Dropdown.Menu>
              </Dropdown>
              
              
            </Menu.Menu>
            </Menu>
            </div>
            
    
        );
    }
    
}

export default Navbar;
